{
  "name": "Plane",
  "description": "Plane helps you track your issues, epics, and product roadmaps.",
  "repository": "http://github.com/makeplane/plane",
  "logo": "https://avatars.githubusercontent.com/u/115727700?s=200&v=4",
  "website": "https://plane.so/",
  "success_url": "/",
  "stack": "heroku-22",
  "keywords": [
    "plane",
    "project management",
    "django",
    "next"
  ],
  "addons": [
    "heroku-postgresql:mini",
    "heroku-redis:mini"
  ],
  "buildpacks": [
    {
      "url": "https://github.com/heroku/heroku-buildpack-python.git"
    },
    {
      "url": "https://github.com/heroku/heroku-buildpack-nodejs#v176"
    }
  ],
  "env": {
    "EMAIL_HOST": {
      "description": "Email host to send emails from",
      "value": ""
    },
    "EMAIL_HOST_USER": {
      "description": "Email host to send emails from",
      "value": ""
    },
    "EMAIL_HOST_PASSWORD": {
      "description": "Email host to send emails from",
      "value": ""
    },
    "EMAIL_FROM": {
      "description": "Email Sender",
      "value": ""
    },
    "EMAIL_PORT": {
      "description": "The default Email PORT to use",
      "value": "587"
    },
    "AWS_REGION": {
      "description": "AWS Region to use for S3",
      "value": "false"
    },
    "AWS_ACCESS_KEY_ID": {
      "description": "AWS Access Key ID to use for S3",
      "value": ""
    },
    "AWS_SECRET_ACCESS_KEY": {
      "description": "AWS Secret Access Key to use for S3",
      "value": ""
    },
    "AWS_S3_BUCKET_NAME": {
      "description": "AWS Bucket Name to use for S3",
      "value": ""
    },
    "SENTRY_DSN": {
      "description": "",
      "value": ""
    },
    "WEB_URL": {
      "description": "Web URL for Plane this will be used for redirections in the emails",
      "value": ""
    },
    "GITHUB_CLIENT_SECRET": {
      "description": "GitHub Client Secret",
      "value": ""
    },
    "NEXT_PUBLIC_API_BASE_URL": {
      "description": "Next Public API Base URL",
      "value": ""
    },
    "SECRET_KEY": {
      "description": "Django Secret Key",
      "value": ""
    }
  }
}

{
  "$schema": "https://turbo.build/schema.json",
  "globalEnv": [
    "NODE_ENV",
    "NEXT_PUBLIC_API_BASE_URL",
    "NEXT_PUBLIC_ADMIN_BASE_URL",
    "NEXT_PUBLIC_ADMIN_BASE_PATH",
    "NEXT_PUBLIC_SPACE_BASE_URL",
    "NEXT_PUBLIC_SPACE_BASE_PATH",
    "NEXT_PUBLIC_WEB_BASE_URL",
    "NEXT_PUBLIC_LIVE_BASE_URL",
    "NEXT_PUBLIC_PLAUSIBLE_DOMAIN",
    "NEXT_PUBLIC_CRISP_ID",
    "NEXT_PUBLIC_ENABLE_SESSION_RECORDER",
    "NEXT_PUBLIC_SESSION_RECORDER_KEY",
    "NEXT_PUBLIC_EXTRA_IMAGE_DOMAINS",
    "NEXT_PUBLIC_POSTHOG_KEY",
    "NEXT_PUBLIC_POSTHOG_HOST",
    "NEXT_PUBLIC_POSTHOG_DEBUG",
    "NEXT_PUBLIC_SUPPORT_EMAIL",
    "SENTRY_AUTH_TOKEN",
    "SENTRY_ORG_ID",
    "SENTRY_PROJECT_ID",
    "NEXT_PUBLIC_SENTRY_ENVIRONMENT",
    "NEXT_PUBLIC_SENTRY_DSN",
    "SENTRY_MONITORING_ENABLED"
  ],
  "tasks": {
    "build": {
      "dependsOn": ["^build"],
      "outputs": [".next/**", "dist/**"]
    },
    "develop": {
      "cache": false,
      "persistent": true,
      "dependsOn": ["^build"]
    },
    "dev": {
      "cache": false,
      "persistent": true,
      "dependsOn": ["^build"]
    },
    "test": {
      "dependsOn": ["^build"],
      "outputs": []
    },
    "lint": {
      "outputs": []
    },
    "start": {
      "cache": false
    },
    "clean": {
      "cache": false
    }
  }
}
